const Form = ( props ) => {
    return (
        <form>
            <InputField type="text" id="prenom" label="Prenom"/>
            <InputField type="text" id="nom" label="nom"/>
            <label htmlFor="bio">Bio</label><textarea name="" id="bio" cols="30" rows="3"></textarea>
        </form>
    );
};
export default Form;
